import React from 'react';

function App() {
    return(
        <div>
            <h2>Todo:</h2>
            <ol>
                <li>
                    <input type="checkbox"></input>
                    <span>Buy milk</span>
                </li>
                <li>
                    <input type="checkbox"></input>
                    <span>Buy bread</span>
                </li>
                <li>
                    <input type="checkbox"></input>
                    <span>Buy cow</span>
                </li>
            </ol>
        </div>
    )
};

export default App;
